import React, {useState} from 'react';


//Create an array of data
const employees = [
  "anthony",
  "kevin",
  "Magnus"
];

export default function App() {
  return (
    <div className="App">
      {employees.map((employee) => {
        return <h1>{employee}</h1>;
      })}
    </div>
  );
}
